// 应用数据扩展
if (typeof window !== 'undefined') {
    // 使用多种方式确保数据增强模块正确应用
    function applyDataEnhancement() {
        if (typeof DB !== 'undefined' && DB.gb && DB.astm && DB.en) {
            // 扩展现有数据而不是替换
            DB.gb = [...DB.gb, ...EnhancedDB.gb.slice(5)]; // 跳过原有的5个数据
            DB.astm = [...DB.astm, ...EnhancedDB.astm.slice(6)]; // 跳过原有的6个数据
            DB.en = [...DB.en, ...EnhancedDB.en.slice(5)]; // 跳过原有的5个数据
            
            // 为每个数据项添加必要的字段
            ['gb', 'astm', 'en'].forEach(standard => {
                DB[standard].forEach((item, index) => {
                    if (!item.id) {
                        item.id = `${standard}_${index}`;
                        item.standard = standard.toUpperCase();
                    }
                    // 确保所有元素含量字段都存在
                    ['c_content', 'si_content', 'mn_content', 'p_content', 's_content', 
                     'cr_content', 'ni_content', 'mo_content'].forEach(field => {
                        const elementKey = field.replace('_content', '');
                        const chineseKey = {
                            'c': '碳', 'si': '硅', 'mn': '锰', 'p': '磷', 
                            's': '硫', 'cr': '铬', 'ni': '镍', 'mo': '钼'
                        }[elementKey];
                        if (chineseKey && item[chineseKey] && !item[field]) {
                            item[field] = item[chineseKey];
                        }
                    });
                });
            });
            
            console.log('✅ 数据增强模块已成功应用');
            console.log(`📊 数据统计: GB(${DB.gb.length}) ASTM(${DB.astm.length}) EN(${DB.en.length})`);
            return true;
        }
        return false;
    }
    
    // 立即尝试应用
    if (!applyDataEnhancement()) {
        // 如果立即应用失败，等待DOM加载完成
        document.addEventListener('DOMContentLoaded', function() {
            if (!applyDataEnhancement()) {
                // 如果还是失败，使用定时器重试
                let retryCount = 0;
                const retryInterval = setInterval(() => {
                    if (applyDataEnhancement() || retryCount++ > 10) {
                        clearInterval(retryInterval);
                        if (retryCount > 10) {
                            console.warn('⚠️ 数据增强模块应用失败');
                        }
                    }
                }, 100);
            }
        });
    }
}